/*Table structure for table `tbl_stop` */

DROP TABLE IF EXISTS `tbl_stop`;

CREATE TABLE `tbl_stop` (
  `id` bigint(20) NOT NULL,
  `stationStage` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `train` bigint(20) DEFAULT NULL,
  `arrivalTime` bigint(20) DEFAULT NULL,
  `departureTime` bigint(20) DEFAULT NULL,
  `wait` int(10) unsigned DEFAULT '0',
  `vehicle` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FKFE727E348C9B82E` (`stationStage`),
  KEY `FKFE727E3817D5D96` (`train`),
  CONSTRAINT `FKFE727E348C9B82E` FOREIGN KEY (`stationStage`) REFERENCES `tbl_station_stage` (`id`),
  CONSTRAINT `FKFE727E3817D5D96` FOREIGN KEY (`train`) REFERENCES `tbl_train` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

